description:
डोटीमा १ जना पुरुष मृत फेला परेका छन् ।&amp;nbsp;

आदर्श गाउँपालिका ३ ऐली बस्ने ५० वर्षीय तुले लुहार शनिबार मृत&amp;nbsp;फेला परेका प्रहरीले जनाएको छ ।

जिल्ला प्रहरी कार्यालय डोटीले दिएका जानकारी अनुसार उनी&amp;nbsp;आफ्नै घर नजिकैको&amp;nbsp;सडक छेउ

खोटाङको जन्तेढुंगा गाउँपालिकाको एउटा कुना, जहाँको माटो र पसिनासँग एउटा बालकको बाल्यकाल जोडिएको थियो । &amp;nbsp;

वरिपरि पहाडका थुम्का, तलतिर बगिरहेका साना खोला र बिहानैदेखि बेलुकासम्म खेतबारीमा पसिना बगाउने एउटा सामान्य कृषक परिवार ।&amp;nbsp;

त्यह
